column8:
●パワフル植毛で奥歯の汚れゾーンにぴったりフィットし、落ちにくい歯垢も残らずスッキリ落とします。<br>
●全3色：グリーン、ブルー、ピンク（お色は選べません)<br><br>

【柄の材質】<br>
淡色部：ポリプロピレン、濃色部：EPDM、ポリプロピレン<br>
【毛の材質】<br>
ナイロン<br>
【毛の硬さ】<br>
かため<br>
【耐熱温度】<br>
80度<br><br>

【ご注意】<br>
○毛先を上手に使って、軽く小刻みに磨きましょう。力の入れすぎは、歯ぐきを傷つける原因にもなります。<br>
○毛先がひらいたらとりかえましょう<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
花王<br>
墨田区文花2-1-3<br>
消費者相談室：0120-165-696<br><br>

【商品区分】<br>
日用品<br><br>

［Kao/クリアクリーン］

<br><br><br><hr>
広告文責：株式会社モリキ<br>
電話：0269-38-0611<br><style type="text/css">
